    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!
{% endblock %}
{% block tabLogin %}active{% endblock %}
{% block refHome %}{{ path('main') }}{% endblock %}
   {% block stylesheets %}
       <style>

           img {
               width: 50%;
               height: auto;
               max-width: 50%;
               display: block;
               margin-left: auto;
               margin-right: auto;

           }

       </style>

   {% endblock %}

{% block body %}






    <div class=\"container\" style=\" margin-left: auto;margin-right: auto;margin-top: 1cm;\" >
        <div class=\"row justify-content-start\">
            <div class=\"col-lg-4\"></div>
            <div class=\"col-lg-4\">
                <div class=\"card\" style=\"width: 18rem;text-align: center;\">
                    <img src=\"/images/login.svg\" class=\"card-img-top\" alt=\"login\">
                    <div class=\"card-body\">
                        <h5 class=\"card-title\">Sign In</h5>
                        <p class=\"card-text\">
                        <form method=\"post\" id=\"inputForm\">
                            {% if error %}
                                <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
                            {% endif %}

                            <label for=\"inputEmail\" class=\"sr-only\">Email</label>
                            <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" placeholder=\"Email\" required autofocus>
                            <label for=\"inputPassword\" class=\"sr-only\">Password</label>
                            <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Password\" required>

                            <input type=\"hidden\" name=\"_csrf_token\"
                                   value=\"{{ csrf_token('authenticate') }}\"
                            >



                            <div class=\"checkbox mb-3\">
                                <label>
                                    <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                                </label>
                            </div>


                            <button class=\"btn btn-outline-success float-right\" type=\"submit\">
                                Sign in
                            </button>
                        </form>
                        </p>
                    </div>
                </div>
            </div>
            <div class=\"col-lg-4\"></div>
        </div>

    </div>



{% endblock %}
", "security/login.html.twig", "/home/ishara/lampstack-7.1.29-0/apache2/htdocs/openRoadTolling/templates/security/login.html.twig");
